// 
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './NutritionPage.css';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';

const NutritionPage = () => {
  const [selectedDate, setSelectedDate] = useState(new Date());
  const [isCalendarOpen, setIsCalendarOpen] = useState(false);

  const [meals, setMeals] = useState({
    breakfast: [],
    lunch: [],
    dinner: [],
  });

  const handleCalendarToggle = () => {
    setIsCalendarOpen(!isCalendarOpen);
  };

  const handleDateChange = (date) => {
    setSelectedDate(date);
    setIsCalendarOpen(false);
  };

  return (
    <div className="nutrition-container">
      {/* 달력 버튼 */}
      <div className="calendar-section">
        <span className="selected-date">
          {selectedDate.toLocaleDateString('ko-KR')}
        </span>
        <button className="calendar-button" onClick={handleCalendarToggle}>
          달력
        </button>
      </div>

      {/* 달력 표시 */}
      {isCalendarOpen && (
        <DatePicker
          selected={selectedDate}
          onChange={handleDateChange}
          inline
          className="datepicker"
        />
      )}

      {/* 영양 정보 섹터 */}
      <div className="nutrition-info">
        <p>
          섭취 칼로리: <b>1500</b> / 권장 칼로리: <b>2000</b> kcal
        </p>
        <p>
          섭취 단백질: <b>50g</b> / 권장 단백질: <b>75g</b>
        </p>
        <p>탄수화물: 200g | 지방: 50g | 당: 20g</p>
      </div>

      {/* 식사 섹터 */}
      <div className="meal-section">
        <div className="meal-time">
          <h3 className="meal-title">아침</h3>
          <div className="meal-items">
            {meals.breakfast.length > 0 ? (
              meals.breakfast.map((food, index) => (
                <p key={index} className="meal-item">
                  {food}
                </p>
              ))
            ) : (
              <p>등록된 음식이 없습니다.</p>
            )}
          </div>
        </div>
        <hr className="divider" />
        <div className="meal-time">
          <h3 className="meal-title">점심</h3>
          <div className="meal-items">
            {meals.lunch.length > 0 ? (
              meals.lunch.map((food, index) => (
                <p key={index} className="meal-item">
                  {food}
                </p>
              ))
            ) : (
              <p>등록된 음식이 없습니다.</p>
            )}
          </div>
        </div>
        <hr className="divider" />
        <div className="meal-time">
          <h3 className="meal-title">저녁</h3>
          <div className="meal-items">
            {meals.dinner.length > 0 ? (
              meals.dinner.map((food, index) => (
                <p key={index} className="meal-item">
                  {food}
                </p>
              ))
            ) : (
              <p>등록된 음식이 없습니다.</p>
            )}
          </div>
        </div>
      </div>

      {/* 네비게이터 바 */}
      <div className="navigator">
        <Link to="/nutrition" className="navigator-item active">
          식단
        </Link>
        <Link to="/habit" className="navigator-item">
          습관
        </Link>
        <button className="navigator-item camera">📷</button>
        <Link to="/mypage" className="navigator-item">
          마이페이지
        </Link>
        <Link to="/call" className="navigator-item">
          문의하기
        </Link>
      </div>
    </div>
  );
};

export default NutritionPage;
